import React from "react";

const table = (props) => {
  data = { props };
  const titles = Object.keys(props.data[0]);
  return (
    <div>
      <h2>Frequently Requested Materials</h2>
      <table>
        <thead>
          <tr>
            {titles.map((title) => (
              <th key={title}>{title}</th>
            ))}
          </tr>
        </thead>

        <tbody>
          <tr>
            {props.data.map((item, i) => (
              <td key={i}>{item}</td>
            ))}
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default table;
